import { Component } from '@angular/core';

@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.scss']
})
export class EventosComponent {

  public eventos: any = [
    {
      Tema: 'Angular 11',
      Local: 'São Paulo'
    },
    {
      Tema: 'Angular e .NET 6',
      Local: 'Fortaleza'
    },
    {
      Tema: 'React JS e .NET 6',
      Local: 'Rio de Janeiro'
    }
]

  constructor(){}

  ngOnInit(): void {

  }

}
<p>eventos works!</p>

<div *ngFor="let evento of eventos">
  <p>Tema: <span>{{evento.Tema}}</span></p>
  <p>Local: <span>{{evento.Local}}</span></p>
</div>
